import axios from 'axios'
import React, { memo, useEffect, useState } from 'react'

var error = "";
const Details = ({ isbn }) => {
  const [detail, setDetail] = useState([]);
  useEffect(() => {
    if (isbn === "") {
      axios.get(`https://openlibrary.org${isbn}.json`)
        .then(resp => setDetail(resp.data))
        .catch(err => { error = err })
        console.log();
    }
  }, [isbn])
  return (
    <div>Details</div>
  )
}

export default memo(Details)
